import React from "react";

function Items({ items }) {
  return (
    <div className="card">
      <img className="item-image" src={items.image} />
      <h4>{items.title}</h4>
      <p className="details">{items.details}</p>
      <p className="price">{items.price}</p>
      <a href="#" className="btn">
        ReadMore...
      </a>
    </div>
  );
}

export default Items;
